import './comp.css';

function Comp05(props) {
    const num1 = 3;
    const num2 = 4;
    return (
        <div className="comp comp01">
            <h3><span>05</span>implement js into html tags</h3>
            <div>
                result: {num1} * {num2} = {num1 ** num2}
            </div>
        </div>
    )
}

export default Comp05;
